import * as React from "react";
import { Modal } from "react-bootstrap";
import Typography from "@mui/material/Typography";
import { Button } from "@mui/material";
import "./Modal.css";
import { ModalContext } from "../../../context/modalContext";

export default function InfoModal({ open, handleClose, children }) {

  const { modal, setModal } = useContext(VaultContext);

  return (
    <Modal show={open} onHide={handleClose} className="info-modal">
      <Modal.Title>Terms and Conditions</Modal.Title>

      <Typography id="transition-modal-description">{modal[0]}</Typography>

      <Button variant="contained" onClick={handleClose}>
        Aceptar
      </Button>
    </Modal>
  );
}
